const SRC_E_Texto_Json = await fetch("../../data/Beneficios.json");

const SRC_E_Texto = await SRC_E_Texto_Json.json();

export default function Beneficios() {
  return (
    <ytm-lp-small-feature-section-view-model>
      <div class="Container_Icon_Beneficios">
        <img
          className="Icon_Beneficios"
          src="https://www.gstatic.com/youtube/img/promos/growth/premium_lp2_small_feature_Ad-free_dark_tablet_600x444.webp"
        />
      </div>
      <div className="Texto_Beneficios">
        Sem anúncios, para que você assista seus vídeos favoritos sem
        interrupção
      </div>
    </ytm-lp-small-feature-section-view-model>
  );
}
